- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    employs one full time employee, the Executive Director, whose time is more than
    25 percent devoted to federal elections and candidates.  Disbursements for salary,
    health benefits, and taxes of the Executive Director are reported on Schedule
    B supporting line 30(b) of this report. No other entity pays compensation for
    their employees to work for the Committee. The Committee does not engage in any
    fundraising on behalf of candidates for Federal office, so all of its reported
    fundraising expenses are party fundraising. The Committee maintains both Federal
    and Non Federal accounts.  During September 2010, the Committee transferred allocable
    expenses from the Non Federal account to the Federal account using the 85% - 15%
    split.  The Committee will do so again in October 2010.  The purpose of the first
    amendment was to provide memo entries supporting a credit card payment.  The purpose
    of this amendment is to clarify that, with the exception of staff salaries and
    payments to political consultants, all disbursements reported on Schedule B line
    30(b) are for volunteer exempt activities.  Also, this amendment identifies the
    federal candidates benefitting from the Committee?s disbursements for Federal
    Election Activity listed on Schedule B supporting Line 30(b).\n"
